import style from "../../Courses.module.css";
function Text(props) {
  return (
    <div className={style.personalStep}>
      <div>
        <div className={style.stepTitle}>{props.stepTitle}</div>

        <div>{props.stepContent}</div>
      </div>
    </div>
  );
}
export default Text;
